/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Fragment } from 'react';
import Link from 'next/link';
import { Button } from 'react-bootstrap';

const Header = (props) => {
  console.log(Button);
  return (
    <Fragment>
      <div>
        <Link href="/">
          <a>Index</a>
        </Link>
        <Link href="/login">
          <a>Login</a>
        </Link>
        <Button>
          <i className="fa fa-search" aria-hidden="true" />
        </Button>
      </div>
    </Fragment>
  );
};

export default Header;
